import React, { useState, useEffect } from "react";
import axios from "axios";

function UpdateRating() {
    // State to hold the updated data
    const [updated, setupdated] = useState([]);

    // Fetch updated data from the API
    useEffect(() => {
      axios.get("http://localhost/COMP333_HW3/index.php/updaterating")
        .then((response) => {
          setupdated(response.data);
        })
        .catch((error) => {
          console.error("Error fetching updated data:", error);
        });
    }, []);

    return (
      <div>
        <h1>Update Rating</h1>
        <ul>
          {updated.map((updated) => (
            <li key={updated.id}>
              Artist: {updated.artist}, Song: {updated.song}, Rating - must be 1-5: {updated.rating}
            </li>
          ))}
        </ul>
      </div>
    );
  }

  export default UpdateRating;
